-  Bem vindos ao grupo Império Moon. Esse grupo tem como finalidade a socialização e a Interação entre os membros, para fazer novas amizades, conversar e compartilhar idéias, memes e opiniões.

-  Para uma boa convivência entre os membros, são necessárias algumas regras para manter o respeito e ordem dentro do nosso grupo.

- O descumprimento de qualquer uma dessas regras resultará em um aviso, com dois avisos você será banido do grupo permanentemente.

_⠀🌕  '䨻 Algumas Proibições ៹䨻䨻䨻⠀_

-  Dentre as nossas regras, temos algumas proibições básicas. Neste grupo, é proibido:

🌙  -  Gore ou Automutilação;

🌙  -  Qualquer tipo de comentários Ofensivos, sem qualquer intimidade com a pessoa;

🌙  -  Adesivos e conteúdos +18;

🌙  -  Desrespeito com participantes e ADMS, xingamentos e até calúnias;

🌙  -  Spam ( Links );

🌙  -  Flood;

🌙  -  Corrente;

🌙  -  Assédio;

🌙  -  Gadear sem Permissão ou consentimento;

🌙  -  Invasão de Privado;

🌙  -  Bullying ou Injúrias;

🌙  -  Iniciar Ligações;

- PV dos ADMs aberto para denúncias.

-  Use do bom senso mas também tenha bom senso, não venha cometer uma infração e justificar com a falta de tal nas regras do grupo, é questão de bom senso e consciência que fez algo de errado, evite descumprir os direitos humanos e não cometa infrações jurídicas se não será banido, mantenha o respeito e a ordem acima de tudo.

-  Boa estadia no Grupo! Quaisquer dúvidas ou denúncias, contatem algum dos nossos ADMs.

